import React from 'react';
import './App.css';
import Dashboard from './Components.js/Dashboard/Admin';
import DashboardTable from './Components.js/Tables/SampleData';
import { Routes, Route } from "react-router-dom";

function App() {

  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Dashboard />} />
        <Route path="Table" element={<DashboardTable />} />
      </Routes>
    </div>
  );
}

export default App;
